import React from 'react';

const Avg_Per_Day = (props) => {

    const display_value = '23';
    if (props.selection = 'day') {
        display_value = props.day_value;
    }


    return(
        <text style={{
        color: props.colour,
        }}>{display_value}</text>
        )}

export default Avg_Per_Day;
